import React from "react";

const AddEditListing = () => {
  return (
    <div className="container mt-5">
      <h2>Add/Edit Listing</h2>
      <form>
        <div className="mb-3">
          <label htmlFor="propertyName" className="form-label">Property Name</label>
          <input type="text" id="propertyName" className="form-control" placeholder="Enter property name" />
        </div>
        <div className="mb-3">
          <label htmlFor="location" className="form-label">Location</label>
          <input type="text" id="location" className="form-control" placeholder="Enter location" />
        </div>
        <div className="mb-3">
          <label htmlFor="price" className="form-label">Price</label>
          <input type="number" id="price" className="form-control" placeholder="Enter price" />
        </div>
        <div className="mb-3">
          <label htmlFor="description" className="form-label">Description</label>
          <textarea id="description" className="form-control" placeholder="Enter description"></textarea>
        </div>
        <button type="submit" className="btn btn-success">Save</button>{" "}
        <button type="button" className="btn btn-secondary">Cancel</button>
      </form>
    </div>
  );
};

export default AddEditListing;
